import "./Test.css";
import Button from "../components/Button";

const Test = () => {
    return (
        <div>
            <div className="selection">
                <Button text="1"/>
                <Button text="2"/>
                <Button text="3"/>
                <Button text="4"/>
                <Button text="5"/>
            </div>
            <Button text="< 이전"/>
            <Button text="다음"/>
        </div>
    )
}

export default Test;
